// src/components/Navbar.tsx
import React from 'react';

const Navbar: React.FC = () => {
    return (
        <nav className="flex justify-between items-center p-4 bg-white shadow-md">
            <h1 className="text-lg font-semibold">Digital Fund Management System</h1>
            <div className="space-x-4">
                <a href="#chit-plans" className="text-gray-600">Chit Plans</a>
                <a href="#services" className="text-gray-600">Services</a>
                <a href="#faqs" className="text-gray-600">FAQs</a>
                <a href="#contact" className="text-gray-600">Contact</a>
                <button className="px-4 py-1 border rounded-md">Log In</button>
                <button className="px-4 py-1 bg-blue-600 text-white rounded-md">Register</button>
            </div>
        </nav>
    );
};

export default Navbar;
